class ScrollButton {
    constructor(imageSrc, buttonType, rightStyle, marginRightStyle, backgroundStyle, translateY, heightTop) {
        this.text = buttonType;
        this.button = document.createElement("button");
        this.button.classList.add(buttonType);

        const self = this;

        // 向 background script 发送消息请求按钮状态
        chrome.runtime.sendMessage({ action: 'getButtonStatus' }, (response) => {
            // 根据返回的按钮状态设置按钮的显示与隐藏
            self.button.style.display = response.buttonVisible ? "block" : "none";
        });

        // chrome.runtime.onMessage.addListener(function (request, sender, sendResponse) {

        /**
         * buttonType
         *  return top-button and bottom-button
         * @type {string}
         */
        this.button.style.position = "fixed";
        this.button.style.right = rightStyle;
        this.button.style.marginRight = marginRightStyle;
        this.button.style.top = getImagePath(buttonType + "-position");
        this.button.style.transform = translateY;
        this.button.style.cursor = "grab";
        this.button.style.height = heightTop;
        this.button.style.background = backgroundStyle;
        this.button.style.borderStyle = "none";
        this.button.style.zIndex = "99999999999999999";

        const img = document.createElement("img");
        img.src = imageSrc;
        img.alt = "icon";

        this.button.appendChild(img);

        document.body.appendChild(this.button);

        this.makeDraggable();
        this.addClickListener();
    }

    addClickListener() {
        this.button.addEventListener("click", () => {
            const scrollTarget = this.button.classList.contains("top-button") ? 0 : this.calculateScrollTarget();
            window.scrollTo({
                top: scrollTarget,
                behavior: 'smooth'
            });
        });
    }

    calculateScrollTarget() {
        const windowHeight = window.innerHeight || document.documentElement.clientHeight || document.body.clientHeight;
        const documentHeight = Math.max(
            document.body.scrollHeight,
            document.documentElement.scrollHeight,
            document.body.offsetHeight,
            document.documentElement.offsetHeight,
            document.body.clientHeight,
            document.documentElement.clientHeight
        );
        return documentHeight - windowHeight;
    }

    makeDraggable() {
        let isDragging = false;
        let offsetX, offsetY;

        this.button.addEventListener("mousedown", (event) => {
            isDragging = true;
            offsetX = event.clientX - this.button.getBoundingClientRect().left;
            offsetY = event.clientY - this.button.getBoundingClientRect().top;
            this.button.style.cursor = "grabbing";
        });

        document.addEventListener("mousemove", (event) => {
            if (isDragging) {
                let x = event.clientX - offsetX;
                let y = event.clientY - offsetY;

                this.button.style.left = x + "px";
                this.button.style.top = y + "px";
            }
        });

        document.addEventListener("mouseup", () => {
            isDragging = false;
            this.button.style.cursor = "grab";
        });
    }
}

