const buttonTop = new ScrollButton(getImagePath("top-button"),
    "top-button",
    getImagePath("bottom-button-right"),
    getImagePath("bottom-button-marginRight"),
    getImagePath("main-button-background"),
    getImagePath("main-button-transform"),
    getImagePath("main-button-height"),
);

const buttonBottom = new ScrollButton(getImagePath("bottom-button"),
    "bottom-button",
    getImagePath("bottom-button-right"),
    getImagePath("bottom-button-marginRight"),
    getImagePath("bottom-button-background"),
    getImagePath("main-button-transform"),
);

function getImagePath(buttonType) {
    const imagePathObj = getImagePathObject();

    return imagePathObj[buttonType];
}

